import React from "react";

const Inputfield = (props) => {
    return (
        <div style={styles.container}>
            <div style={styles.title}>{props.title}</div>
            <input
                className="InputField"
                type="text"
                placeholder={props.placeholder} />
        </div>
    )
}

const styles = {
    container: {
        display: 'flex',
        flexDirection: 'row',
        alignItems: 'center',
        gap: 24,
    },
    title: {
        color: '#808080',
        fontSize: 20,
        fontWeight: 600
    },
};


export default Inputfield;
